import React from 'react';
import { Outlet ,Link} from 'react-router-dom';

const Benefits = () => {

    return (
        <>
            <div>
                <Link to="/dasboard">
                    <a>&lt- Back to Dashboard</a>
                </Link>
            </div>
            <div className='section-margin'>
                <Outlet />
            </div>
        </>
    )
}
export default Benefits;
